script: |
  super -f text -I q12420.spq | sort > q12420.out

inputs:
  - name: q12420.spq
    data: |
      SELECT + col2 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT 99 / col2 + - col0 NOT IN ( 36 * - + col1 + + 94 + - col1 * + col2 * + col2 );
  - name: tab0

outputs:
  - name: q12420.out
    data: |
